import Phaser from 'phaser'
import game from './game.js'
var Uplayer;
var Downlayer;
var Leftlayer;
var Rightlayer;
//Level1 scene
class GameSceneLv1 extends Phaser.Scene {
    constructor() {
      super({ key: 'GameSceneLv1' });
    }



 preload() {
  this.load.image('lab', 'TileMap/lab.png');
  this.load.tilemapTiledJSON('tilemap', 'TileMap/lv1.json');
  this.load.spritesheet('doofusrick','Assets/animation/rick.png',{ frameWidth: 370, frameHeight: 654  });
  this.load.spritesheet('idlePortal','Assets/animation/portal1.png',{frameWidth:300,frameHeight:350});
 }



 create() {

    const map = this.make.tilemap({ key: 'tilemap' });
    const tileset = map.addTilesetImage('lab', 'lab');
    map.createStaticLayer('TopLayer', tileset);
    const platfromLayer = map.createLayer('platform', tileset);
    Uplayer = map.createLayer('UpArrow',tileset);
    Downlayer= map.createLayer('DownArrow',tileset);
    Leftlayer= map.createLayer('LeftArrow',tileset);
    Rightlayer= map.createLayer('RightArrow',tileset);
    map.createStaticLayer('gameOver',tileset);



    gameState.active = true;
    gameState.cursors = this.input.keyboard.createCursorKeys();
    //create Object
    gameState.player = this.physics.add.sprite(50,750, 'doofusrick'   ).setScale(.1);
    gameState.portal = this.physics.add.sprite(780,250, 'idlePortal').setScale(.4)
    gameState.portal.flipX = true;
    //set position and collision
    gameState.player.setCollideWorldBounds(true);

    platfromLayer.setCollisionBetween(1,800);


    this.physics.add.collider(gameState.player, platfromLayer);
    this.physics.add.overlap(gameState.player,gameState.portal,()=> {this.scene.start('GameSceneLv2')});
     gameState.portal.anims.play('idlePortal',true);
    this.anims.create( {
        key:'run',
        frames: this.anims.generateFrameNumbers( 'doofusrick',
                                              {start: 1, end:4}
                                             ),
                                             frameRate: 20,
                                             repeat: -1


       } );
       this.anims.create( {
        key:'idle',
        frames: this.anims.generateFrameNumbers( 'doofusrick',
                                              {start: 1, end:1}
                                             ),
                                             frameRate: 1,
                                             repeat: -1


       } );


       gameState.player.body.gravity.y = 1500
       }

 update() {


    if (gameState.active) {
        gravityArrow(gameState.player);
        control(gameState.player);
 }
 flipPlayerSprite(gameState.player);

 }
}


